(155, 'WO-2022000155', NULL, 'Rutgerkemme@hotmail.com', 'complete', NULL, '{\"name\":\"Rutger Kemme\",\"phone\":\"0031640267490\",\"newsletter\":false,\"invoice\":false}', '{\"name\":\"Roos Lease\",\"phone\":\"0031640267490\",\"address\":\"Carrer d\'Obradors 2\",\"city\":\"Barcelona\",\"zip\":\"08002\",\"info\":\"Please ring the bell at PRAL 2A and ask for Roos Lease.\",\"dedication\":\"Lieve Roos,\\r\\n\\r\\nVandaag is een van die dagen dat ik super graag met je zou willen zijn. Precies \\u00e9\\u00e9n jaar geleden stapte ik s\\u2019ochtends vroeg bij je uit bed toen we voor de eerste keer samen hadden geslapen. \\r\\n\\r\\nElke keer als ik denk aan de de periode sindsdien, maakt het mij zo blij om met jou te zijn. Ondanks het feit dat we ver uit elkaar zijn, ben ik zo gelukkig met hoe het gaat tussen ons, ben ik trots op je als persoon en om je mijn vriendin te mogen noemen. \\r\\n\\r\\nOmdat dit een dag is die we normaal samen zouden vieren maar dat nu niet mogelijk is, wilde ik in ieder geval ervoor zorgen dat jij kan genieten. \\r\\n\\r\\nOmdat ik weet hoeveel je van mijn fantastische massages houdt, maar ik je nog veel beter gun dacht ik aan een klein cadeautje voor je. Kijk snel op je whatsapp om te zien wat dit is \\ud83d\\ude0a\\r\\n\\r\\nIk houd van je \\u2764\\ufe0f\\u2764\\ufe0f\",\"delivery_type\":\"2\",\"delivery_date\":\"MON 14-02-2022 15:00-21:30\"}', NULL, '{\"CAVV\":\"aksrSW5TakV6a1dGQ1JCRFVFOHdBcElBQUFBPQ==\",\"AVSADDRESSRESULT\":\"VQ==\",\"AUTHENTICATION_VALUE\":\"\",\"ECI\":\"Mg==\",\"CVNRESULT\":\"TQ==\",\"HPP_LANG\":\"ZW4=\",\"MESSAGE_VERSION\":\"\",\"PASREF\":\"MTY0NDc1ODk0Mzg4ODU0Mzk=\",\"BATCHID\":\"MTMxNjk4MTM=\",\"MESSAGE\":\"QXBwcm92ZWQ=\",\"DS_TRANS_ID\":\"\",\"ACCOUNT\":\"aW50ZXJuZXQ=\",\"XID\":\"TnNxeFl2S3V6THcyRTR2SS9yTUIzN3hVVXdzPQ==\",\"SHA1HASH\":\"MWY4YzU4OGRlZGY2NjdhZjdiYTBiNTA2OWU2ZDUxZTZjOWNiYjk3MQ==\",\"AVSPOSTCODERESULT\":\"VQ==\",\"ORDER_ID\":\"MTMwMjIwMjJfMTQtMjhfU0RLX3YyLTEtMF9OREZrTVdRek1XWXRPRw==\",\"AMOUNT\":\"NDY4MA==