(6, 'algunas-de-las-plantas-medicinales-mas-comunes', 'algunas-de-las-plantas-medicinales-mas-comunes', 'algunas-de-las-plantas-medicinales-mas-comunes', 'blog', 'Plantas', 'medicina', '{\"es\":\"Algunas de las plantas medicinales m\\u00e1s comunes\",\"ca\":\"Algunas de las plantas medicinales m\\u00e1s comunes\",\"en\":\"Algunas de las plantas medicinales m\\u00e1s comunes\"}', '{\"es\":\"Hasta hace no demasiados a\\u00f1os, las plantas y flores, m\\u00e1s que un elemento decorativo, eran populares por ser los ingredientes de medicinas y remedios que curaban todo tipo de mal (bueno, vi\\u00e9ndolo con perspectiva quiz\\u00e1 es muy osado decirlo, pero en ese entonces eran miraculosas). Con los avances tecnol\\u00f3gicos, hemos prescindido de muchas de ellas, pero sigue habiendo muchas plantas que cuentan con unas propiedades que nos pueden ser muy beneficiosas y nos pueden sacar de m\\u00e1s de un apuro. En esta entrada os vamos a mostrar algunas de las plantas medicinales m\\u00e1s comunes que podemos encontrar hoy d\\u00eda. Porque nunca sabes cuando te puedes encontrar en el monte y que te aparezca de la nada una indigesti\\u00f3n salvaje\\u2026\",\"ca\":\"Hasta hace no demasiados a\\u00f1os, las plantas y flores, m\\u00e1s que un elemento decorativo, eran populares por ser los ingredientes de medicinas y remedios que curaban todo tipo de mal (bueno, vi\\u00e9ndolo con perspectiva quiz\\u00e1 es muy osado decirlo, pero en ese entonces eran miraculosas). Con los avances tecnol\\u00f3gicos, hemos prescindido de muchas de ellas, pero sigue habiendo muchas plantas que cuentan con unas propiedades que nos pueden ser muy beneficiosas y nos pueden sacar de m\\u00e1s de un apuro. En esta entrada os vamos a mostrar algunas de las plantas medicinales m\\u00e1s comunes que podemos encontrar hoy d\\u00eda. Porque nunca sabes cuando te puedes encontrar en el monte y que te aparezca de la nada una indigesti\\u00f3n salvaje\\u2026\",\"en\":\"Hasta hace no demasiados a\\u00f1os