ntor-top-column elementor-element elementor-element-7728502\\\" data-id=\\\"7728502\\\" data-element_type=\\\"column\\\">\\r\\n<div class=\\\"elementor-column-wrap elementor-element-populated\\\">\\r\\n<div class=\\\"elementor-widget-wrap\\\">\\r\\n<div class=\\\"elementor-element elementor-element-4747d9c elementor-widget elementor-widget-text-editor\\\" data-id=\\\"4747d9c\\\" data-element_type=\\\"widget\\\" data-widget_type=\\\"text-editor.default\\\">\\r\\n<div class=\\\"elementor-widget-container\\\">\\r\\n<div class=\\\"elementor-text-editor elementor-clearfix\\\">\\r\\n<p>El cilantro es una planta arom&aacute;tica utilizada para la elaboraci&oacute;n y complementaci&oacute;n de platos de la cocina de distintos lugares del mundo. Y es que es una planta de la que <strong>se pueden usar todas sus partes<\\/strong>, des de las semillas hasta las hojas. &iexcl;Y todas ellas con un sabor bien caracter&iacute;stico!<\\/p>\\r\\n<p>Adem&aacute;s de ser un aliado excelente para los cocineros, sus <strong>propiedades antiinflamatorias, antis&eacute;pticas y analg&eacute;sicas<\\/strong> hacen que el cilantro est&eacute; bien vista por los expertos en salud. &iexcl;Un remedio natural para prevenir muchos males!<\\/p>\\r\\n<p>Aunque es una planta a la que <strong>le encanta el sol<\\/strong> debes ir con cuidado y <strong>no regarla en exceso<\\/strong>, ya que se puede ahogar f&aacute;cilmente y morir. &iexcl;Y des de luego eso es lo &uacute;ltimo que queremos!<\\/p>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<div class=\\\"elementor-column elementor-col-33 elementor-top-column elementor-element elementor-element-b9185bc\\\" data-id=\\\"b9185bc\\\" data-element_type=\\\"column\\\">\\r\\n<div class=\\\"elementor-column-wrap elementor-element-populated\\\">\\r\\n<div class=\\\"elementor-widget-wrap\\\">\\r\\n<div class=\\\"elementor-element elementor-element-d5471b5 elementor-widget elementor-widget-image\\\" data-id=\\\"d5471b5\\\" data-element_type=\\\"widget\\\" data-widget_type=\\\"image.default\\\">\\r\\n<div class=\\\"elementor-widget-container\\\">\\r\\n<div class=\\\"elementor-image\\\"><img class=\\\"attachment-large size-large\\\" src=\\\"https:\\/\\/rosistirem.com\\/wp-content\\/uploads\\/2021\\/07\\/jacqueline-brandwayn-sNjKMbL5xWU-unsplash-768x1024.jpg\\\" alt=\\\"\\\" width=\\\"768\\\" height=\\\"1024\\\" \\/><\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/section>\\r\\n<section class=\\\"elementor-section elementor-top-section elementor-element elementor-element-8119a06 elementor-section-boxed elementor-section-height-default elementor-section-height-default\\\" data-id=\\\"8119a06\\\" data-element_type=\\\"section\\\">\\r\\n<div class=\\\"elementor-container elementor-column-gap-default\\\">\\r\\n<div class=\\\"elementor-row\\\">\\r\\n<div class=\\\"elementor-column elementor-col-100 elementor-top-column elementor-element elementor-element-26abd93\\\" data-id=\\\"26abd93\\\" data-element_type=\\\"column\\\">\\r\\n<div class=\\\"elementor-column-wrap\\\">\\r\\n<div class=\\\"elementor-widget-wrap\\\">&nbsp;<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/div>\\r\\n<\\/section>\\r\\n<h2 class=\\\"elementor-heading-title elementor-size-default\\\">&nbsp;<\\/h2>\"}', '{\"title\":{\"es\":\"Otras de las mejores plantas arom\\u00e1ticas\",\"ca\":\"Otras de las mejores plantas arom\\u00e1ticas\",\"en\":\"Otras de las mejores plantas arom\\u00e1ticas\"},\"description\":{\"es\":\"Otras de las mejores plantas arom\\u00e1ticas\",\"ca\":\"Otras de las mejores plantas arom\\u00e1ticas\",\"en\":\"Otras de las mejores plantas arom\\u00e1ticas\"}}', '{\"header_image\":\"resources\\/HHkWndw0MiFWwC2xJ3QXw3Xl25gJ5sgFahm22PCA.jpg\"}', 1, '2022-01-26 11:57:49', '2022-01-27 16:09:20'),
(9, 'cuidados/maranta-leuconera-tricolor', 'cures/maranta-tricolor', 'cares/maranta-leuconera-tricolor', 'care', '', '', '{\"ca\":\"MARANTA TRICOLOR\",\"es\":\"MARANTA LEUCONERA TRICOLOR\",\"en\":\"MARANTA LEUCONERA TRICOLOR\"}', '{\"ca\":\"Vaja vaja vaja, per\\u00f2 quina planta m\\u00e9s curiosa... El primer que vaig pensar en veure-la va ser que es tractava d\'una pe\\u00e7a de museu d\'art.\\r\\nDes del primer moment vaig quedar fascinat per les seves fulles verdes amb aquests nervis vermelles tan cridaners. I per no parlar del revers de les fulles, que \\u00e9s de color lila. Sens dubte, digna d\'estar exposada al MNAC!\\r\\nM\'he adonat que \\u00e9s una planta s\\u00faper f\\u00e0cil de cuidar. Ser\\u00e0 un regal ideal per al meu cos\\u00ed que no t\\u00e9 ni idea de plantes. Tot i aix\\u00f2 anotar\\u00e9 eles poques cures que necessita.\",\"es\":\"Vaya vaya vaya, pero que planta m\\u00e1s curiosa\\u2026 Lo primero que pens\\u00e9 al verla fue que se trataba de una pieza de un museo de arte.\\r\\nDesde el primer momento, quede fascinado por sus hojas verdes con esos nervios rojos tan llamativos. Y por no hablar del reverso de la hoja, que es de color p\\u00farpura. \\u00a1Sin duda, digna de estar expuesta al MNAC!\\r\\nMe he dado cuenta de que es una planta s\\u00faper f\\u00e1cil de cuidar. Ser\\u00e1 un regalo ideal para mi primo que no tiene ni idea de plantas. Aun as\\u00ed, voy a apuntar los pocos cuidados que necesita.\",\"en\":\"Well, well, well, what a curious plant... The first thing I thought when I saw it was that it was a piece from an art museum.\\r\\nFrom the very first moment, I was fascinated by its green leaves with those striking red veins, not to mention the back of the leaf, which is purple. Not to mention the purple reverse side of the leaf. Definitely a plant worthy of being exhibited at the MNAC!\\r\\nI realised that it\'s a super easy plant to take care of. It will be an ideal gift for my cousin who has no idea about plants. Even so, I\'m going to write the few cares it needs down.\"}', '\"\"', '\"\"', '{\"productId\":\"4\",\"techName\":\"MARANTA LEUCONERA TRICOLOR\",\"family\":\"MARANT\\u00c1CEAS\",\"ubication\":\"1\",\"complexity\":\"1\",\"origin_ca\":\"BRASIL\",\"origin_es\":\"BRASIL\",\"origin_en\":\"BRAZIL\",\"techs_ca\":\"PET FRIENDLY|PLANTA D\'INTERIOR|PRINCIPIANTS\",\"techs_es\":\"PET FRIENDLY|PLANTA DE INTERIOR|PRINCIPIANTES\",\"techs_en\":\"PET FRIENDLY|INDOOR PLANT|BEGINNERS\",\"care1_ca\":\"Per les seves caracter\\u00edstiques, considero que \\u00e9s una planta ideal per a interiors..\\r\\nUna manera f\\u00e0cil per saber com cuidar-la \\u00e9s pensar en el seu clima d\'origen: el tropical. I si un pensa en el clima tropical, el primer que li ve al cap \\u00e9s... sol i pluja! Aix\\u00ed que el millor ser\\u00e0 col\\u00b7locar-la en un espai ben il\\u00b7luminat, per\\u00f2 sense que li toqui el sol de manera directa. \\r\\nTamb\\u00e9 \\u00e9s important que es mantingui en un lloc fresc amb temperatures altes, que no baixin mai dels 10\\u00baC, i amb un ambient preferiblement humit.\",\"care1_es\":\"Por sus caracter\\u00edsticas, considero que es una planta ideal para interior.\\r\\nUna manera f\\u00e1cil para saber como cuidarla es pensar en su clima de origen: el tropical. Y si uno piensas en el clima tropical lo primero que le viene a la cabeza es\\u2026, \\u00a1sol y lluvia! As\\u00ed que lo mejor ser\\u00e1 colocarla en un sitio bien iluminado, pero que no le toque el sol de manera directa. \\r\\nTambi\\u00e9n es importante que se mantenga en un lugar con temperaturas altas, que no bajen nunca de los 10\\u00ba C, y con un ambiente preferiblemente h\\u00famedo.\",\"care1_en\":\"Because of its characteristics, I consider it to be a fantastic indoor plant..\\r\\nAn easy way to know how to take care of Maranta, is to think of its origin climate: the tropical one. And if you think of a tropical climate, the first thing that comes to mind is... sun and rain! So the best thing to do is place it in a well-lit areabut not in direct sunlight. \\r\\nIt is also important to kept it in a place with high temperatures, never below 10\\u00b0C, and preferably in a humid environment.\",\"care2_ca\":\"Amb compte de no embassar-la, \\u00e9s important regar-la abundantment, sobretot durant els mesos de calor. Precisament en aquests mesos m\\u00e9s calorosos, agrair\\u00e0 si se li ruixa aigua diversos cops a les fulles. Com aquells dies d\'estiu que de sobte et cau un ruixat que no saps d\'on ha aparegut, per\\u00f2 et refresca un munt i et sents de meravella.\\r\\nPer ser un aut\\u00e8ntic expert, cada dues setmanes cal abonar-la amb fertilitzant l\\u00edquid o cristal\\u00b7l\\u00ed soluble, no molt ric en nitrogen, perqu\\u00e8 creixi amb tota la seva esplendor i lliure de malalties i plagues. \\r\\nDurant els primers anys de vida, preferiblement durant la primavera o estiu, hauria de ser trasplantada a un test nou, ja que amb el pas del temps, a ella tamb\\u00e9 li queda la roba petita!\",\"care2_es\":\"Con cuidado de no encharcarla, es importante regarla abundantemente, sobre todo durante los meses de calor. Precisamente en estos meses tan calurosos, sus hojas te agradecer\\u00e1n que las roc\\u00edes con agua varias veces al d\\u00eda. Como esos d\\u00edas de verano que de repente cae un chaparr\\u00f3n que no sabes de donde ha salido, pero te sienta de maravilla.\\r\\nPara ser un aut\\u00e9ntico experto, cada dos semanas se debe abonar con un fertilizante l\\u00edquido o cristalino soluble, no muy ricos en nitr\\u00f3geno, para que crezca con todo su esplendor y libre de enfermedades y plagas. \\r\\nDurante los primeros a\\u00f1os de vida de nuestra amiga, preferiblemente durante primavera o verano, deber\\u00eda ser trasplantada a una maceta nueva, \\u00a1a ella tambi\\u00e9n le queda la ropa peque\\u00f1a con el paso del tiempo!\",\"care2_en\":\"It is important to water it abundantly, especially during the hot months, taking care not to flood it.Precisely in these hot months, its leaves will thank you for spraying them with water several times a day. Just like those summer days when it suddenly starts raining, and it feels so good.\\r\\nTo be a real expert, every two weeks they should be fertilised with a liquid or soluble crystalline fertiliser, not too rich in nitrogen, so that they grow in all their splendour and free of diseases and pests. \\r\\nDuring the first years of our friend\'s life, preferably in spring or summer, it should be transplanted into a new pot!\",\"care3_ca\":\"La plaga m\\u00e9s comuna i perillosa per a la Maranta Tricolor \\u00e9s l\'aranya vermella, que sol apar\\u00e8ixer quan fa molta calor i no hi ha humitat (no, no \\u00e9s l\'Spiderman). Per contra, durant els mesos m\\u00e9s freds i amb exc\\u00e9s d\'humitat, pot patir de botritis. Per\\u00f2 aquesta es pot evitar f\\u00e0cilment amb una bona ventilaci\\u00f3.\",\"care3_es\":\"La plaga m\\u00e1s com\\u00fan y peligrosa para la Maranta Tricolor es la ara\\u00f1a roja, que suele aparecer cuando hace mucho calor y no hay humedad (no, no se trata de Spiderman). Por el contrario, durante los meses m\\u00e1s fr\\u00edos y con exceso de humedad, puede padecer de botritis. Pero esta se puede evitar f\\u00e1cilmente con buena ventilaci\\u00f3n.\",\"care3_en\":\"The most common and dangerous pest for the Maranta Tricolor is the red spider mite, which usually appears when it is very hot and there is no humidity (no, it is not Spiderman). In contrast, during the cooler months and with excess humidity, it can suffer from botrytis. But this can be easily avoided with good ventilation.\",\"annotations_ca\":\"M\'he fixat que a les nits tanca una mica les seves fulles. Ara entenc perqu\\u00e8 l\'anomenen planta de l\'oraci\\u00f3\\u2026 \\u00a1Parece que est\\u00e9 rezando! Cada vez estoy m\\u00e1s enamorada de esta planta. Y lo mejor es que es de tipos perenne, \\u00a1as\\u00ed que la podr\\u00e9 disfrutar todo el a\\u00f1o!\\r\\nTotes aquestes fulles juntes i aquests colors tan alegres em fan pensar en Malasia, aix\\u00ed que l\'anomenar\\u00e9 aix\\u00ed. Podria ser una planta digne dels seus habitants!\",\"annotations_es\":\"Me he fijado que por las noches cierra un poco sus hojas. Ahora entiendo por qu\\u00e9 la llaman planta de la oraci\\u00f3n\\u2026 \\u00a1Parece que est\\u00e9 rezando! Cada vez estoy m\\u00e1s enamorada de esta planta. Y lo mejor es que es de tipos perenne, \\u00a1as\\u00ed que la podr\\u00e9 disfrutar todo el a\\u00f1o!\\r\\nTodas esas hojas juntas y esos colores tan alegres me hacen pensar en Malasia, as\\u00ed que la llamar\\u00e9 as\\u00ed. \\u00a1Podr\\u00eda ser una planta digna de sus habitantes!\",\"annotations_en\":\"I have noticed that at night it closes its leaves a bit. Now I understand why they call it the prayer plantIt looks like it is praying! I am more and more in love with this plant. And the best thing is that it is an evergreen type, so I can enjoy it all year round!\\r\\nAll those leaves together and those cheerful colours make me think of Malaysia, so I\'ll call it that. It could be a plant worthy of its inhabitants!\",\"header_image\":\"resources\\/XFZJOO9B5Z25RFbTXsufrMyLEmpwFcMIfqIThb5A.jpg\"}', 1, '2022-02-07 08:49:04', '2022-02-07 08:49:04');
